import axios from 'axios'

const url = 'http://127.0.0.1:3001/api/auth/register/'

export const registerUser = (login,full_name, email,password) => axios.post("http://127.0.0.1:3001/api/auth/register/",{login:login, full_name:full_name, email:email,password:password})
